import com.sap.cloud.sdk.cloudplatform.connectivity.DestinationAccessor;
import com.sap.cloud.sdk.cloudplatform.connectivity.Destination;
import com.sap.cloud.sdk.s4hana.datamodel.odata.services.AwesomeService;
import com.sap.cloud.sdk.s4hana.datamodel.odata.services.DefaultAwesomeService;
import java.util.List;
import com.sap.cloud.sdk.s4hana.datamodel.odata.namespaces.entity.AwesomeEntity;

